import React from "react";

const ListOfGoals = ({ allGoals }) => {
  return (
    <ul>
      {allGoals?.map((ele, idx) => (
        <li key={idx + idx}>
          <p>
            My goal is to {ele.goal}, by {ele.by} .
          </p>
        </li>
      ))}
    </ul>
  );
};

export default ListOfGoals;
